public int minPathDown ( TreeNode root ) { 
     if ( root == null ) 
         return 0 ; 
     int pathSum = 0 ; 
     if ( root.left != null ) { 
         pathSum = minPathDown ( root.left ) + root.val ; 
     } 
     if ( root.right != null ) { 
         pathSum = minPathDown ( root.right ) + root.val ; 
     } 
     if ( pathSum < min ) { 
         min = pathSum ; 
     } 
     return min ; 
}
